@afrosandaudio made making connections just as important as the educational content! 

Loved having the opportunity to meet with so many of my podcasting internet friends, some of whom we met for the first time in Baltimore.

If you are thinking about attending Afros & Audio next year, do it. No more questions asked!

🍽️ Foodies save this later! 

If you enjoy dining experiences, you’re in for a delicious treat when you @visitthenorthshore! 

Here are some of my favorite restaurants and eateries you have to check out! 

@palmettosotb for a scenic brunch by the Bayou 🥂

@mattina_bella for finger licking breakfast and lunch - I’m still daydreaming about the Eggs Sardou with Spinach Florentine!

@rootsplantsandcoffee Black-owned coffee shop in Old Town Slidel for relaxation, greenery and caffeine ☕️

@southernhotel for cocktails - they make a mean Old Fashion 🥃

@thegloriette for French-inspired cuisine. Perfect for date night. 

@tavirestaurant for delicious hummus plates 🤤

